// src/App.js
import React from 'react';
import Form from './components/Form';
import DataList from './components/DataList';

const Login = () => {
  return (
    <div>
      <h1>Form Submission with Redux Toolkit</h1>
      <Form />
      <DataList />
    </div>
  );
};

export default Login;
